  true,\n\t\"url\": null,\n\t\"notes\": \"Although a State's actual agricultural export
  value cannot be measured directly, ERS maintains estimates of State shares of U.S.
  exports for total and selected individual commodities based on U.S. farm cash-receipts
  data. The estimates are for calendar years, with annual estimates available for
  2000-2011.   ERS has discontinued updates of an alternative fiscal-year (October
  to September) series of State export estimates based on State and commodity shares
  of production, but continues to provide the historical estimates based on that methodology.\",\n\t\"license_title\":
